INSERT INTO `carreras` VALUES (1,1,'Hotelería y Administración','Conviértete en un especialista en la elaboración y cumplimiento de estrategias de negocios aplicadas a la hotelería.','Nuestro programa desarrolla profesionales en la gestión hotelera, con una propuesta especializada en administración empresarial y un enfoque internacional que te permitirá generar emprendimientos innovadores de negocios sostenibles en la industria hotelera. Si eres empático, cuentas con habilidades para los idiomas y valoras la diversidad social y cultural, esta carrera es para ti.','https://pregrado.upc.edu.pe/facultad-de-administracion-en-hoteleria-y-turismo/hoteleria-y-administracion/','1.png','2019-08-27 02:04:53','1'),(2,1,'Turismo y Administración','Profesionales que diseñan proyectos turísticos rentables, ambientalmente sostenibles y de gran impacto social y cultural con una visión innovadora.','Nuestro programa desarrolla profesionales capaces de gestionar y administrar destinos y empresas turísticas con enfoque en innovación. Al graduarte en Turismo y Administración, conocerás y manejarás tendencias como el ecoturismo, turismo vivencial, turismo de aventuras y turismo alternativo con visión internacional. Si cuentas con un espíritu viajero, eres expresivo, tienes talentos para resolver problemas con creatividad y vocación de servicio, esta carrera es para ti.','https://pregrado.upc.edu.pe/facultad-de-administracion-en-hoteleria-y-turismo/turismo-y-administracion/','2.png','2019-08-27 02:05:36','1'),(3,1,'Gastronomía y Gestión Culinaria','Sé un clamado autor de la innovación culinaria. Vive tu pasión por la cocina a través de prestigiosos convenios internacionales, de la mano de Virgilio Martinez, uno de los mejores chefs del mundo.','Nuestro programa desarrolla profesionales íntegros e innovadores para liderar un desarrollo culinario y gastronómico económicamente rentable, y formar a los mejores cocineros y empresarios. Al graduarte en Gastronomía y Gestión Culinaria, contarás con las herramientas necesarias para representar nuestra identidad culinaria y crear un estilo propio con argumentos sólidos. Si eres un apasionado de la cocina, curioso e investigador, emprendedor e intuitivo para los negocios, así como perfeccionista y perseverante, esta carrera es para ti.','https://pregrado.upc.edu.pe/facultad-de-administracion-en-hoteleria-y-turismo/gastronomia-y-gestion-culinaria/','3.png','2019-08-27 02:05:36','1'),(4,2,'Arquitectura','Toda tu creatividad y pasión para ser el arquitecto de un mundo asombroso.','Una profesión creativa que conceptualiza, diseña y edifica, espacios y estructuras para la vida. Como arquitecto podrás dedicarte al urbanismo, diseño, desarrollo, remodelación, renovación, restauración y dirección de proyectos. Te gusta el arte, la pintura y el dibujo; eres creativo y detallista; te interesa el diseño; eres observador, analítico y responsable; trabajas en equipo; y tienes habilidad con el razonamiento matemático.','https://pregrado.upc.edu.pe/facultad-de-arquitectura/arquitectura/','4.png','2019-08-27 02:06:12','1'),(5,3,'Música','¡Atrévete a potenciar tu mejor talento y vive tu pasión!','Recibirás una formación musical teórica y práctica, de estándar internacional, complementada con herramientas de gestión que te permitirán vivir de tu vocación. Preparamos profesionales apasionados con una visión integral de la industria, lo que te permitirá aprovechar oportunidades en el campo de la música y del entretenimiento.','https://pregrado.upc.edu.pe/facultad-de-artes-contemporaneas/carrera-de-musica/','5.png','2019-08-27 02:09:55','1'),(6,3,'Artes Escénicas','Prepárate para destacar en el mundo del teatro y la actuación.','Preparamos profesionales multidisciplinarios capaces de adaptarse al género, formato o medio, con estilo propio, para aprovechar las oportunidades del mercado y desarrollar al máximo su creatividad e innovación, además de mostrar tu trabajo al mundo en su máxima expresión.','https://pregrado.upc.edu.pe/facultad-de-artes-contemporaneas/carrera-de-artes-escenicas/','6.png','2019-08-27 02:09:55','1'),(7,4,'Medicina','La profesión más noble y apasionante, enseñada como nunca antes.','Tiene un alto diferencial en cuanto a infraestructura, tecnología, equipos de última generación y un currículo moderno y diferenciado que permite a los estudiantes tener una formación sólida, desde el primer ciclo, en todos los campos necesarios para convertirse en médicos altamente capacitados.','https://pregrado.upc.edu.pe/facultad-de-ciencias-de-la-salud/medicina/','7.png','2019-08-27 02:09:55','1'),(8,4,'Nutrición y Dietética','Vive de una carrera fascinante en el mundo, capaz de crear una cultura de salud preventiva en nuestro país.','Profesional con una sólida base científica y alto compromiso social, capaz de diagnosticar e intervenir los problemas de salud en Nutrición Clínica, Nutrición Pública o Ciencias de los Alimentos, con el objetivo de garantizar el bienestar individual y social.','https://pregrado.upc.edu.pe/facultad-de-ciencias-de-la-salud/nutricion-y-dietetica/','8.png','2019-08-27 02:09:55','1'),(9,4,'Odontología','Tu vocación y talento, más toda la tecnología odontológica, para crear las más bellas sonrisas en las personas.','Una carrera que se sustenta en una sólida base científica, que fomenta la formación exigente con entrenamiento en simuladores y pacientes reales. Como odontólogo, serás capaz de atender, diagnosticar, tratar y prevenir problemas de salud oral del individuo, la familia y la comunidad. También estarás preparado para administrar tu propia clínica dental. ¿Quieres saber más? Puedes coordinar una cita con nuestro director de carrera al correo: Eduardo.morzan@upc.pe','https://pregrado.upc.edu.pe/facultad-de-ciencias-de-la-salud/odontologia/','9.png','2019-08-27 02:09:55','1'),(10,4,'Terapia Física','Devuelve la salud y el bienestar a las personas con una profesión altamente demandada en el mundo y con múltiples campos de aplicación.','Especialista con una visión integral, habilidades de gestión y aptitudes sólidas para la prevención, tratamiento, rehabilitación y promoción del bienestar físico de las personas.','https://pregrado.upc.edu.pe/facultad-de-ciencias-de-la-salud/terapia-fisica/','10.png','2019-08-27 02:09:55','1'),(11,4,'Medicina Veterinaria','Un programa diferente, integrado, apoyado sólidamente en tecnología y el uso de la simulación.','Una carrera que se sustenta en una sólida base científica. Recibirás conocimientos en técnicas quirúrgicas, fisioterapia y rehabilitación animal. Como médico veterinario, serás capaz de prevenir, diagnosticar y tratar enfermedades en pequeñas y grandes especies. Además, estarás preparado para administrar tu propio consultorio o clínica veterinaria. ¿Quieres sabes más? Puedes coordinar una cita con nuestro director de carrera al correo: Rodrigo.rondón@upc.pe','https://pregrado.upc.edu.pe/facultad-de-ciencias-de-la-salud/medicina-veterinaria/','11.png','2019-08-27 02:09:55','1'),(12,5,'Traducción e Interpretación Profesional','Vive de tu pasión por los idiomas a través de un permanente intercambio de experiencias culturales.','Una carrera que forma traductores e intérpretes profesionales mediante una metodología de enseñanza innovadora, la mejor tecnología y convenios internacionales. Además, es el único programa en América Latina y el tercero en las Américas en obtener la membresía de la CIUTI, importante asociación internacional.','https://pregrado.upc.edu.pe/facultad-de-ciencias-humanas/traduccion-e-interpretacion-profesional/','12.png','2019-08-27 06:11:03','1'),(13,6,'Comunicación Audiovisual y Medios Interactivos','Asombra al mundo: lleva la comunicación a niveles inimaginables a través de los medios del futuro.','Formamos profesionales capaces de elaborar estrategias creativas para diversos medios convencionales (cine, radio y televisión), así como para nuevos medios (internet y plataformas digitales) y múltiples formatos y soportes tecnológicos que respondan a las necesidades del público.','https://pregrado.upc.edu.pe/facultad-de-comunicaciones/comunicacion-audiovisual-y-medios-interactivos/','13.png','2019-08-27 06:11:04','1'),(14,6,'Comunicación e Imagen Empresarial','Imagen corporativa y relación sostenible con el entorno para los retos más apasionantes de las organizaciones de hoy.','Preparamos profesionales éticos, líderes en la creación de una comunicación constructiva y de ambientes de bienestar en la organización. Gestionarás de manera integral la imagen y reputación de las organizaciones, liderando las relaciones positivas con: colaboradores, proveedores, clientes, entre otros públicos de interés.','https://pregrado.upc.edu.pe/facultad-de-comunicaciones/comunicacion-e-imagen-empresarial/','14.png','2019-08-27 06:11:04','1'),(15,6,'Comunicación y Marketing','Marketing y comunicación para un nuevo consumidor, una carrera que retará toda tu creatividad y capacidad estratégica.','Como marketero y comunicador podrás tomar decisiones estratégicas que agreguen valor a la empresa en la que trabajes. Preparamos profesionales innovadores con una sólida base en marketing estratégico, comunicación 360, marketing digital, comportamiento del consumidor, investigación de mercados y gestión de negocio.','https://pregrado.upc.edu.pe/facultad-de-comunicaciones/comunicacion-y-marketing/','15.png','2019-08-27 06:11:04','1'),(16,6,'Comunicación y Periodismo','Toda tu audacia y pasión por la investigación para influir positivamente en tu entorno y transformarlo.','Preparamos profesionales con una sólida base cultural que permite la comprensión de los sucesos locales y globales. Capaces de investigar, interpretar y comunicar de manera veraz y concisa los acontecimientos, brindando al público información que contribuya a la vida en sociedad.','https://pregrado.upc.edu.pe/facultad-de-comunicaciones/comunicacion-y-periodismo/','16.png','2019-08-27 06:11:04','1'),(17,6,'Comunicación y Publicidad','Creatividad al máximo para los grandes retos de las marcas en un nuevo entorno global y digital.','Preparamos profesionales creativos y con visión estratégica, capaces de desarrollar mensajes persuasivos alineados a objetivos específicos y orientados a públicos objetivos.','https://pregrado.upc.edu.pe/facultad-de-comunicaciones/comunicacion-y-publicidad/','17.png','2019-08-27 06:11:04','1'),(18,6,'Comunicación y Fotografía','Prepárate para comunicar de manera estratégica, innovadora y única a través de imágenes de alta calidad e impacto.','Formamos profesionales en Fotografía, capaces de comunicar mensajes innovadores con creatividad, fluidez, integridad y respeto, expresando la cultura de su época a través de una visión global. Creando imágenes de alta calidad, empleando modernos equipos de fotografía, aplicando herramientas digitales contemporáneas, sin desconocer los procesos clásicos fotográficos','https://pregrado.upc.edu.pe/facultad-de-comunicaciones/comunicacion-y-fotografia/','18.png','2019-08-27 06:11:04','1'),(19,7,'Derecho','Sé un abogado que conoce el mundo, con capacidad para la gestión. Prepárate para resolver de forma innovadora los más apasionantes desafíos.','La carrera ofrece una formación multidisciplinaria, orientada no solo al Derecho, sino también a la economía, las finanzas y la gerencia. Como abogado, serás capaz de entender las necesidades de una organización y asesorar a los clientes de forma eficiente. Si cuentas con habilidades de comunicación, eres analítico y crítico, tienes interés por temas sociales, culturales y jurídicos, y te gustan las relaciones interpersonales, esta carrera es para ti.','https://pregrado.upc.edu.pe/facultad-de-derecho/derecho/','19.png','2019-08-27 06:19:22','1'),(20,7,'Relaciones Internacionales','Sé un profesional capaz de liderar las relaciones entre estados y otros actores del contexto internacional, promoviendo exitosamente las buenas prácticas internacionales.','Serás un profesional multidisciplinario con un fuerte compromiso con el desarrollo del país y capaz de proponer soluciones ante sucesos mundiales y/o negociaciones de intercambios comerciales. Si eres analítico, tienes curiosidad por los asuntos globales, eres empático con las personas, estás interesado en la temática internacional, y eres expresivo escrita y oralmente.','https://pregrado.upc.edu.pe/facultad-de-derecho/relaciones-internacionales/','20.png','2019-08-27 06:19:22','1'),(21,8,'Diseño Profesional de Interiores','Crea el espacio ideal en el que sueña vivir cada persona.','Serás un especialista en componer espacios estéticos y funcionales, capaz de integrar de manera armoniosa el entorno, el medioambiente, los materiales y las necesidades del cliente.','https://pregrado.upc.edu.pe/facultad-de-diseno/diseno-profesional-de-interiores/','21.png','2019-08-27 06:19:22','1'),(22,8,'Diseño Profesional Gráfico','Toda tu creatividad y talento para ponerle tu sello a las marcas, productos e iniciativas que van a cambiar el mundo.','Tiene un alto diferencial en cuanto a infraestructura, tecnología, equipos de última generación y un currículo moderno y diferenciado que permite a los estudiantes tener una formación sólida, desde el primer ciclo, en todos los campos necesarios para convertirse en diseñadores altamente capacitados.','https://pregrado.upc.edu.pe/facultad-de-diseno/diseno-profesional-grafico/','22.png','2019-08-27 06:19:22','1'),(23,8,'Diseño y Gestión en Moda','Pon a prueba tu creatividad, conviértete en un referente de la moda y asombra al mundo con tu talento.','Una carrera que forma profesionales íntegros e innovadores, quienes, a través de sus conocimientos teóricos, prácticos y tecnológicos, dominarán habilidades para diseñar, construir y gestionar los procesos dentro de la industria de la moda, tanto en el mercado nacional como en el internacional.','https://pregrado.upc.edu.pe/facultad-de-diseno/diseno-y-gestion-en-moda/','23.png','2019-08-27 06:19:22','1'),(24,9,'Economía y Finanzas','Carrera con una visión financiera global para formar a líderes competentes que aspiran a lo más alto.','Una carrera que te desarrolla como economista financista líder preparado para destacar en las principales organizaciones internacionales, combinando tu talento con nuestra innovadora metodología de enseñanza y simuladores de las bolsas de valores del mundo. Si eres analítico, reflexivo y cuentas con habilidades numéricas entonces esta carrera es para ti.','https://pregrado.upc.edu.pe/facultad-de-economia/economia-y-finanzas/','24.png','2019-08-27 06:19:22','1'),(25,9,'Economía y Negocios Internacionales','La única carrera que combina la pasión por la economía y los negocios internacionales, para que puedas destacar en el mercado local y extranjero.','Desarrollamos profesionales altamente demandados por las organizaciones internacionales, con una sólida base en economía, apasionados por generar valor en la empresa, desarrollando oportunidades de negocio en los mercados globales. Si tienes interese por el desarrollo del comercio internacional y los fenómenos asociados a este, eres analítico y cuentas con habilidades numéricas entonces esta carrera es para ti.','https://pregrado.upc.edu.pe/facultad-de-economia/economia-y-negocios-internacionales/','25.png','2019-08-27 06:19:22','1'),(26,9,'Economía Gerencial','Economía con una visión global e innovadora para alcanzar el liderazgo de las mas grandes corporaciones y organizaciones.','La UPC forma futuros estrategas y directivos que liderarán las organizaciones a partir del entendimiento de la realidad económica, desarrollando proyectos y negocios innovadores. Además, nuestros profesionales potencian la toma de decisiones. Si tienes espíritu emprendedor, capacidad de liderazgo, eres analítico y cuentas con habilidades numéricas entonces esta carrera es para ti.','https://pregrado.upc.edu.pe/facultad-de-economia/economia-gerencial/','26.png','2019-08-27 06:19:22','1'),(27,9,'Ciencias Políticas','Sé un profesional experto en el análisis de procesos políticos, sociales y económicos de la realidad nacional e internacional, capaz de liderar procesos que transformen el país.','Serás un profesional capaz de liderar procesos políticos y organizacionales que transformen el país. Al estudiar Ciencias Políticas podrás analizar factores políticos, sociales y económicos a nivel nacional e internacional. Si eres analítico, tienes un solido interés en temas de coyuntura nacional e internacional y por el bien común, eres sensible socialmente, tienes interés por el sector público y político; y eres expresivo escrita y oralmente.','https://pregrado.upc.edu.pe/facultad-de-economia/ciencias-politicas/','27.png','2019-08-27 06:19:22','1'),(28,10,'Educación y Gestión del Aprendizaje','Vive tu vocación con la formación universitaria más innovadora y las últimas tendencias en el aprendizaje y la pedagogía.','Preparamos profesionales con una formación integral organizada en módulos que articulan los fundamentos del campo educativo, con habilidades de gestión, el uso intensivo de la tecnología y el idioma inglés, con una visión integral del sector educativo y una sólida formación teórico-práctica.','https://pregrado.upc.edu.pe/facultad-de-educacion/educacion-y-gestion-del-aprendizaje/','28.png','2019-08-27 06:19:22','1'),(29,11,'Ciencias de la Computación','Vive tu pasión por la creación de nuevos mundos digitales y sé el artífice de una nueva realidad.','La automatización está presente en todo ámbito de nuestra vida y se basa en el desarrollo de software complejo, uso de tecnologías disruptivas que revolucionan el mundo, como Data Science, para el descubrimiento de información valiosa para los negocios, el desarrollo de sistemas complejos de seguridad de la información, análisis forense, reconstrucción de información ante ataques digitales y la inteligencia artificial.','https://pregrado.upc.edu.pe/facultad-de-ingenieria/ciencias-de-la-computacion/','29.png','2019-08-27 06:19:22','1'),(30,11,'Ingeniería Civil','Deja tu huella en el mundo y construye un entorno soñado a través de una carrera hecha para este gran momento.','Una carrera que forma profesionales especializados en el diseño y la construcción de vías, inmuebles, sistemas hídricos, puertos y aeropuertos liderados por una adecuada gestión. Nuestros egresados contribuyen a la mejora de la calidad de vida de los habitantes de un país. Si eres hábil para el trabajo interdisciplinario y quieres construir el futuro del país y dejar tu huella en el mundo, esta carrera es para ti.','https://pregrado.upc.edu.pe/facultad-de-ingenieria/ingenieria-civil/','30.png','2019-08-27 06:19:22','1'),(31,11,'Ingeniería de Gestión Empresarial','Ingeniería y gestión para gerenciar la innovación en las organizaciones.','En un campo de acción múltiple que abarca la gestión de la innovación, la gerencia de proyectos, el desarrollo de productos y de servicios, la dirección económica y financiera.','https://pregrado.upc.edu.pe/facultad-de-ingenieria/ingenieria-de-gestion-empresarial/','31.png','2019-08-27 06:19:22','1'),(32,11,'Ingeniería de Gestión Minera','Vive de una profesión soñada que te llevará a gerenciar el desarrollo sostenible de todo un país.','La minería es una actividad fundamental para la economía peruana: ha sido fuente importante de riquezas a lo largo de nuestra historia y tiene un potencial aún inexplorado.','https://pregrado.upc.edu.pe/facultad-de-ingenieria/ingenieria-de-gestion-minera/','32.png','2019-08-27 06:19:22','1'),(33,11,'Ingeniería de Sistemas de Información','El poder de la información digital de las organizaciones en tus manos.','Hoy la información es un recurso económico vital, difícil de procesar y de acumular. Es por ello que analizarla, sistematizarla y optimizarla de manera segura y versátil apunta a un gran reto para ti.','https://pregrado.upc.edu.pe/facultad-de-ingenieria/ingenieria-de-sistemas-de-informacion/','33.png','2019-08-27 06:19:22','1'),(34,11,'Ingeniería de Software','Sé un ingeniero creativo que transforma el mundo con soluciones de software y aplicaciones revolucionarias.','Dirige el desarrollo de software, actividad sumamente sofisticada basada en la aplicación de un enfoque sistemático, disciplinado y cuantificable, al desarrollo, operación y mantenimiento del software.','https://pregrado.upc.edu.pe/facultad-de-ingenieria/ingenieria-de-software/','34.png','2019-08-27 06:19:22','1'),(35,11,'Ingeniería Electrónica','Conviértete en el creador de las tecnologías más asombrosas del futuro.','El progreso de las personas y las sociedades está vinculado al desarrollo de la tecnología. La ingeniería electrónica hace posible una continua expansión hacia nuevos e insospechados horizontes.','https://pregrado.upc.edu.pe/facultad-de-ingenieria/ingenieria-electronica/','35.png','2019-08-27 06:19:22','1'),(36,11,'Ingeniería Industrial','Sé el gerente estratégico de las operaciones y los procesos clave de las organizaciones del futuro.','Una carrera que forma profesionales especialistas en el diseño de la estrategia de cada organización a través de la dirección de sus operaciones, para lograr su objetivo comercial y trazar el camino hacia el éxito. Si tienes interés por la automatización industrial y las nuevas tendencias que revolucionarán la industria mundial, esta carrera es para ti.','https://pregrado.upc.edu.pe/facultad-de-ingenieria/ingenieria-industrial/','36.png','2019-08-27 06:19:22','1'),(37,11,'Ingeniería Mecatrónica','Atrévete a cambiar el mundo, la sociedad y la calidad de vida de las personas con los proyectos de ingeniería más asombrosos.','Una carrera que forma profesionales que parten de la necesidad de combinar la mecánica, la electrónica y la informática para obtener productos, procesos y sistemas que cambien nuestra realidad. Si quieres dominar la construcción de software complejos y seguir revolucionando el Data Science, esta carrera es para ti.','https://pregrado.upc.edu.pe/facultad-de-ingenieria/ingenieria-mecatronica/','37.png','2019-08-27 06:19:22','1'),(38,11,'Ingeniería Ambiental','Haz posible un mundo sostenible para las futuras generaciones.','El desarrollo económico y productivo está fuertemente vinculado al entorno social y ambiental, con el cual se interrelaciona.','https://pregrado.upc.edu.pe/facultad-de-ingenieria/ingenieria-ambiental/','38.png','2019-08-27 06:19:22','1'),(39,12,'Administración y Agronegocios','Transforma la forma de crear, comercializar y exportar productos a través del apasionante mundo de la agroindustria internacional.','En la UPC formamos egresados que aportan a la industria agroalimentaria, con visión y conocimientos de los mercados, que le permita añadir valor en cada paso de la cadena productiva, creando marcas y líneas de nuevos productos de calidad y rentables.','https://pregrado.upc.edu.pe/facultad-de-negocios/administracion-y-agronegocios/','39.png','2019-08-27 06:21:35','1'),(40,12,'Administración y Finanzas','Conviértete en un exitoso gerente de las finanzas corporativas internacionales.','Formamos administradores con una visión global de las finanzas. Serás gestor de alternativas óptimas de inversión en el mercado de capitales, fusiones o adquisiciones, en proyectos nacionales e internacionales desde las más altas posiciones ejecutivas.','https://pregrado.upc.edu.pe/facultad-de-negocios/administracion-y-finanzas/','40.png','2019-08-27 06:21:35','1'),(41,12,'Administración y Marketing','Elabora estrategias de marketing global y digital para las grandes oportunidades de negocio en una apasionante carrera.','La UPC te forma como estratega integral del marketing, un profesional con visión de negocio y capacidad de acción para liderar todas las variables de esta disciplina: el mercado, el producto, la distribución, los precios, la comunicación y la venta.','https://pregrado.upc.edu.pe/facultad-de-negocios/administracion-y-marketing/','41.png','2019-08-27 06:21:35','1'),(42,12,'Administración y Negocios del Deporte','Convierte tu pasión por el deporte en una profesión de alcance internacional.','La UPC brinda una singular propuesta académica especializada en la industria del deporte. Somos la primera universidad en el país con una carrera de gestión deportiva, esto significa un valioso reconocimiento y una gran oportunidad.','https://pregrado.upc.edu.pe/facultad-de-negocios/administracion-y-negocios-del-deporte/','42.png','2019-08-27 06:21:35','1'),(43,12,'Administración y Negocios Internacionales','Sé un gerente del mundo, trabaja en grandes empresas transnacionales o desempéñate como un exitoso empresario de los negocios internacionales.','La UPC te forma como profesional con una visión gerencial y estratégica aplicada al contexto global, experto en identificar y aprovechar las oportunidades en los mercados internacionales.','https://pregrado.upc.edu.pe/facultad-de-negocios/administracion-y-negocios-internacionales/','43.png','2019-08-27 06:21:35','1'),(44,12,'Administración y Recursos Humanos','En tus manos, la gestión del más valioso capital de todas las organizaciones: el talento humano.','La UPC forma gestores del talento capaces de diseñar estrategias que estimulen la productividad de las personas y aseguren la continuidad operativa y cultural de las empresas. Son profesionales que aportan al crecimiento de los colaboradores alineado a los objetivos de negocio.','https://pregrado.upc.edu.pe/facultad-de-negocios/administracion-y-recursos-humanos/','44.png','2019-08-27 06:21:35','1'),(45,12,'Contabilidad y Administración','Conoce una contabilidad estratégica y gerencial para grandes retos corporativos y mundiales.','Preparamos profesionales con una sólida orientación empresarial, capaces de desempeñarse en puestos gerenciales de empresas nacionales e internacionales que ofrecen servicios de auditoría, consultorías tributarias y legales, como en cualquier otra área contable y administrativa.','https://pregrado.upc.edu.pe/facultad-de-negocios/contabilidad-y-administracion/','45.png','2019-08-27 06:21:35','1'),(46,12,'Administración y Gerencia del Emprendimiento','Desarrolla iniciativas empresariales y negocios propios para ser exitosos haciendo lo que más te gusta.','La UPC forma profesionales líderes y altamente innovadores capaces de crear y gestionar soluciones, emprendimientos y modelos de negocio sostenibles que resuelvan grandes necesidades del mercado y contribuyan a transformar el Perú y su entorno.','https://pregrado.upc.edu.pe/facultad-de-negocios/administracion-y-gerencia-del-emprendimiento/','46.png','2019-08-27 06:21:35','1'),(47,13,'Psicología','Explota tu talento para conocer a las personas y sé capaz de transformar y mejorar vidas, sociedades y organizaciones.','Profesional altamente ético y con una visión emprendedora, especialista en diseñar propuestas innovadoras acordes a las necesidades de cambio personal, grupal y empresarial, a fin de lograr una mejor calidad de vida de las personas y de la sociedad.','https://pregrado.upc.edu.pe/facultad-de-psicologia/psicologia/','47.png','2019-08-27 06:22:01','1');
